import React ,{useState} from 'react'
import'./Popup.css'
export default function Popup(props) {

    const [obj,setobj] = useState({
        date:props.date.tostring(),
        time:props.time,
        name:'',
        age:''
    })

  return (
    <div className='pop'>
      
        <div className="nam" >{props.name}</div>
        <input type="text" name='date' value={props.date.toString()} className='w'/>
        <input type="text"  name='time' value={props.time} className='w'/>
        <input type="text" name='name' placeholder='Name' className='w'/>
        <input type="text" name='age' placeholder='Age' className='w'/>
        <button className='button'>Submit</button>


    </div>
  )
}
